import React from "react";
import "./featured.css";

const Featured = () => {
  return (
    <div className="featured" style={{ height: `${window.innerHeight}px` }}>
      <div className="container">
        <div className="name">Joey</div>
        <div className="description">a web developer</div>
      </div>
    </div>
  );
};

export default Featured;
